import React from "react";

function About() {
    return (
        <section id="about" className="section animated slideInLeft">
            <h2>About Us</h2>
            <p>
                JM Foundation is dedicated to eliminating educational inequality through
                innovative AI education software. We blend traditional guidance with cutting-edge
                technology to create tailored pathways for every student's success.
            </p>
            <p>
                Founded on the principle that quality education is a universal right, we continuously
                strive to empower students worldwide.
            </p>
        </section>
    );
}

export default About;
